import React from 'react';

interface Result {
  bidDate: string;
  propertyName: string;
  propertyManagement: string;
  city: string;
  zipCode: string;
  frequency: string;
  areaSize: number;
  lotState: string;
  congestionFactor: string;
  discount: number;
  hourlyRate: number;
  jobTime: number;
  estimatedCost: number;
  totalBidAmount: number;
}

interface ResultsTableProps {
  results: Result[];
}

const ResultsTable: React.FC<ResultsTableProps> = ({ results }) => {
  return (
    <div>
      {results.map((result, index) => (
        <table key={index} style={{ width: '100%', marginBottom: '20px', borderCollapse: 'collapse', border: '1px solid #ddd' }}>
          <thead>
          <tr>
            <th colSpan={2} style={{ textAlign: 'left', padding: '10px', backgroundColor: '#f2f2f2' }}>
              Result {index + 1}
            </th>
          </tr>
          </thead>
          <tbody>
          <tr>
            <td style={{ padding: '10px', border: '1px solid #ddd' }}>
              <strong>Date of Bid</strong>
            </td>
            <td style={{ padding: '10px', border: '1px solid #ddd' }}>{result.bidDate}</td>
          </tr>
          {/* Add more fields as necessary */}
          </tbody>
        </table>
      ))}
    </div>
  );
};

export default ResultsTable;
